import React from 'react';

class Filter extends React.Component {
  render() {
    return (
      <form>
        <label htmlFor="name">Name:</label>
        <input id="name" type="text" value={this.state.name} onChange={this.handleChange} />
      </form>
    );
  }
}

export default Filter;
